import React from "react"
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css"
import './Carousel.scss'

import carousel1 from '../../assets/carousel_1.png'
import carousel2 from '../../assets/carousel_2.png'
import carousel3 from '../../assets/carousel_3.png'
import {} from '../../assets/' 
import offroad from './CarouselCard/offroad_series_bycicle.png'
import road from './CarouselCard/road_series_bycicle.png'
import street from './CarouselCard/street_series_bycicle.png'

const images = [
    {back: carousel3, bycicle_img: offroad},
    {back: carousel1, bycicle_img: road},
    {back: carousel2, bycicle_img: street}
]


function CarouselComponent() {

    return (
        <Carousel
            showIndicators={false}
            showArrows={true}
            showStatus={false}
            centerMode={true}
            showThumbs={false}
            selectedItem={1}
            centerSlidePercentage={45}
            className="carousel"
        >
            {images.map(key => <Card key={key} src={key.back}/>)}
        </Carousel>
    )
}
export default CarouselComponent
